import React from 'react';
import './App.css';
import{Index} from '.';
import {Cadastro} from './Cadastro';
import {AtualizarFuncionario} from './tualizarFuncionario';
import {BrowserRouter, Route, Switch, NavLink} from 'react-router-dom';

function App() {
  return (
    <div className="App container">
      <h3 className = "d-flex justify-content-center m-3">
        React JS front_end
      </h3>

    <nav className='navbar navbar-expand-sm bg-light navbar-dark'>
      <ul className='navbar-nav'>
        <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Index'> 
            Index
          </NavLink>

        </li>
        <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Cadastro'> 
            Cadastro
          </NavLink>

        </li>
        <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/AtualizarFuncionario'> 
            Atualizar Funcionario
          </NavLink>

        </li>

      </ul>

    </nav>

    <Switch>
      <Route path='/Index' componet = {Index} />
      <Route path='/Cadastro' componet = {Cadastro} />
      <Route path='/AtualizarFuncionario' componet = {AtualizarFuncionario} />
    </Switch>
    </div>
  );
}

export default App;
